void ECuddling1(){
	xi=88;
	yi=128;
	for(y=0;y<50; y++){
		for(x=0; x<59; x++){
			point = (y*59)+x;
			LCD_SetPoint(xi, yi, EeveeCuddling1[point]);
			xi++;
		}
		yi++;
		xi=88;
	}
};

